  doc.text(`Aircraft: ${manifestData.aircraft}`, 10, 50);
  doc.text(`Pilot: ${manifestData.pilot}`, 150, 50, {
    align: 'right'
  });
  doc.setFontSize(14);
  doc.text('Passengers', 10, 60);
  doc.setFontSize(12);
  doc.text('Passenger Name', 10, 70);
  doc.text('Pax Weight', 70, 70);
  doc.text('Cargo Pcs', 110, 70);
  doc.text('Weight', 150, 70);
  let startY = 80;
  manifestData.passengers.forEach(pax => {
    doc.text(pax.name, 10, startY);
    doc.text(pax.pax_weight.toString(), 70, startY);
    doc.text(pax.cargo_pcs.toString(), 110, startY);
    doc.text(pax.cargo_weight.toString(), 150, startY);
    startY += 10;
  });
  startY += 10;
  doc.setFontSize(14);
